import React, { Component } from 'react';
import './todolist.scss';

class TodoList extends Component {
  render() {
    return (
      <div className="todoListMain">
        <div className="container">
          <div className="row">
            <div className="col-12">
              <h1>OLAR</h1>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default TodoList;
